import React, { useEffect } from 'react';
import List from "./List";
import { Route, Routes } from 'react-router-dom';

const server_url = 'http://localhost:11037';

var currentList;
var ListURL;

function Lists(props) {
    useEffect(() => {
        // Define an async function to fetch the lists
        const fetchLists = async () => {
            try {
                const options = {
                    method: 'GET',
                    headers: {
                        'Content-Type': 'application/json',
                    }
                }
                const response = await fetch(server_url + '/lists', options);
                const data = await response.json();
                props.setLists(data); // Update the state with the fetched lists
            } catch (error) {
                console.error('Error fetching lists:', error);
            }
        };

        // Call the fetchLists function to fetch the lists
        fetchLists();
    }, []);

    return (
        <div className="homepage">
            <Routes>
                <Route path={'/lists'} element={<><h1 className="">Live User Lists</h1><div className="lists-container">
                    <table>
                        <tr>
                            <th>List</th>
                            <th>Description</th>
                            <th>Created By</th>
                        </tr>
                        {props.lists.map((list, index) => (
                            <tr key={index}>
                                <td><a href={"/lists/" + list.title} className="black-text"><h1>{list.title}</h1></a></td>
                                <td><h3>{list.text}</h3></td>
                                <td><p>{list.username}</p></td>
                            </tr>
                        ))}
                    </table>
                </div></>} />
            </Routes>
            

            <List items={props.movies} />
        </div>
    )
}

export default Lists;
